import React from 'react';

export const Container = ({ children, ...props }) => (
  <div className="container mx-auto px-4" {...props}>{children}</div>
);

export const Typography = ({ variant, children, ...props }) => {
  const classNames = {
    h1: 'text-4xl font-bold',
    h2: 'text-3xl font-bold',
    h3: 'text-2xl font-bold',
    h4: 'text-xl font-bold',
    body1: 'text-base',
    body2: 'text-sm',
  };
  return <p className={classNames[variant] || classNames.body1} {...props}>{children}</p>;
};

export const TextField = React.forwardRef(({ ...props }, ref) => (
  <input
    type="text"
    className="w-full p-2 border border-gray-300 rounded"
    ref={ref}
    {...props}
  />
));

export const Button = ({ children, variant = 'contained', ...props }) => (
  <button
    className={`px-4 py-2 rounded ${
      variant === 'contained' ? 'bg-blue-500 text-white' : 'border border-blue-500 text-blue-500'
    }`}
    {...props}
  >
    {children}
  </button>
);

export const Paper = ({ children, ...props }) => (
  <div className="bg-white shadow-md rounded p-4" {...props}>{children}</div>
);

export const List = ({ children, ...props }) => (
  <ul className="list-none" {...props}>{children}</ul>
);

export const ListItem = ({ children, ...props }) => (
  <li className="mb-2" {...props}>{children}</li>
);

export const ListItemText = ({ primary, ...props }) => (
  <div {...props}>{primary}</div>
);
